LuaScript:
str = {}
    str.non_interactable = "nonint"

function onLoad(save_state)
    SetNonInteractables()
end

function SetNonInteractables()
    local _objs = getAllObjects()
    for key, value in pairs(_objs) do
        if value.getDescription() == str.non_interactable then
            value.interactable = false;
        end
    end
end
